import React from 'react';

function DefaultWeatherSvg(props) {
    return (
        <svg
            xmlns="http://www.w3.org/2000/svg"
            viewBox="0 0 24 24"
            width="100"
            height="100"
            {...props}
        >
            <circle cx="12" cy="12" r="10" fill="none" stroke="currentColor" strokeWidth="2"/>
            <path fill="currentColor" d="M12 3v1M12 20v1M4.22 4.22l.71.71M18.07 18.07l.71.71M3 12h1M20 12h1M4.22 19.78l.71-.71M18.07 5.93l.71-.71"/>
            <path fill="none" stroke="currentColor" strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M12 3c3.31 0 6 2.69 6 6s-2.69 6-6 6-6-2.69-6-6 2.69-6 6-6z"/>
        </svg>
    );
}

export default DefaultWeatherSvg;
